import React from 'react';
import styles from './header.module.css'

const Header = (props) => {
    return(
        <header>
            <img className={styles.logo} src="/images/logo.png" alt="youtube logo"/>
            <input type="search" placeholder="검색"/>
        </header>
    )
};
export default Header;
